import React from 'react';

class AddUser extends React.Component{
    render(){
        return(
            <form>
                <input placeholder='Введите имя пользователя: '/>
                <label htmlFor="isCame">Присутствует ?</label>
                <input type="checkbox" id="isCame"/> 
            </form>
        )
    }
}

export default AddUser;
